import React from 'react';
import '../App.js';

function About() {
        return(
            <div className="card-body">

                <h1 className="card-title">About Me</h1>

                <p className="cardText">Melanie Rogoff is a talented Full-Stack Developer. Skills include JavaScript, MySQL, React, Node, Express, and Responsive Web/App Design.</p>

                <p>Ms. Rogoff will be receiving a certificate in Full-Stack Web Development from the University of Arizona in May 2020.</p>

                <p>Ms. Rogoff currently holds a Bachelor's of Science in Business Management from Arizona State University (4.0 GPA).</p>
            </div>
        )
}
export default About;
